,p_category=>'EFFECT'
,p_supported_ui_types=>'DESKTOP:JQM_SMARTPHONE'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'FUNCTION F_RENDER (',
'    P_DYNAMIC_ACTION   IN   APEX_PLUGIN.T_DYNAMIC_ACTION,',
'    P_PLUGIN           IN   APEX_PLUGIN.T_PLUGIN',
') RETURN APEX_PLUGIN.T_DYNAMIC_ACTION_RENDER_RESULT AS',
'',
'    L_RESULT              APEX_PLUGIN.T_DYNAMIC_ACTION_RENDER_RESULT;',
'    VR_TYPE               P_DYNAMIC_ACTION.ATTRIBUTE_01%TYPE := P_DYNAMIC_ACTION.ATTRIBUTE_01;',
'    VR_CONFIG_JSON        P_DYNAMIC_ACTION.ATTRIBUTE_02%TYPE := P_DYNAMIC_ACTION.ATTRIBUTE_02;',
'    VR_TYPE_CONFIG_JSON   P_DYNAMIC_ACTION.ATTRIBUTE_03%TYPE := NULL;',
'BEGIN',
'',
'    APEX_JAVASCRIPT.ADD_LIBRARY(',
'        P_NAME        => ''avjs.pkgd.min'',',
'        P_DIRECTORY   => P_PLUGIN.FILE_PREFIX,',
'        P_KEY         => ''avjsjssrc''',
'    );',
'',
'    APEX_JAVASCRIPT.ADD_LIBRARY(',
'        P_NAME        => ''vanta.''|| VR_TYPE ||''.min'',',
'        P_DIRECTORY   => P_PLUGIN.FILE_PREFIX || ''vanta/'',',
'        P_KEY         => ''avjs''||VR_TYPE||''jssrc''',
'    );',
'    ',
'    CASE VR_TYPE',
'        WHEN ''waves'' THEN',
'            VR_TYPE_CONFIG_JSON := P_DYNAMIC_ACTION.ATTRIBUTE_03;',
'        WHEN ''net'' THEN',
'            VR_TYPE_CONFIG_JSON := P_DYNAMIC_ACTION.ATTRIBUTE_04;',
'        WHEN ''clouds'' THEN',
'            VR_TYPE_CONFIG_JSON := P_DYNAMIC_ACTION.ATTRIBUTE_05;',
'        WHEN ''clouds2'' THEN',
'            VR_TYPE_CONFIG_JSON := P_DYNAMIC_ACTION.ATTRIBUTE_06;',
'        WHEN ''cells'' THEN',
'            VR_TYPE_CONFIG_JSON := P_DYNAMIC_ACTION.ATTRIBUTE_07;',
'        WHEN ''dots'' THEN',
'            VR_TYPE_CONFIG_JSON := P_DYNAMIC_ACTION.ATTRIBUTE_08;',
'        WHEN ''globe'' THEN',
'            VR_TYPE_CONFIG_JSON := P_DYNAMIC_ACTION.ATTRIBUTE_09;',
'        WHEN ''birds'' THEN',
'            VR_TYPE_CONFIG_JSON := P_DYNAMIC_ACTION.ATTRIBUTE_10;',
'        WHEN ''fog'' THEN',
'            VR_TYPE_CONFIG_JSON := P_DYNAMIC_ACTION.ATTRIBUTE_11;',
'        WHEN ''rings'' THEN',
'            VR_TYPE_CONFIG_JSON := P_DYNAMIC_ACTION.ATTRIBUTE_12;',
'        WHEN ''halo'' THEN',
'            VR_TYPE_CONFIG_JSON := P_DYNAMIC_ACTION.ATTRIBUTE_13;',
'        ELSE',
'            APEX_DEBUG.ERROR(''No animation type found'');',
'    END CASE;',
'',
'    L_RESULT.JAVASCRIPT_FUNCTION := ''function () { apexVantaJSPlugin.initialize( this,'' ||',
'        APEX_JAVASCRIPT.ADD_VALUE(VR_TYPE,TRUE) ||',
'        APEX_JAVASCRIPT.ADD_VALUE(VR_CONFIG_JSON,TRUE) ||',
'        APEX_JAVASCRIPT.ADD_VALUE(VR_TYPE_CONFIG_JSON,TRUE) ||',
'        APEX_JAVASCRIPT.ADD_VALUE(P_PLUGIN.FILE_PREFIX || ''img/noise.png'',FALSE) ||',
'    ''); }'';',
'',
'    RETURN L_RESULT;',
'END;'))
,p_api_version=>1
,p_render_function=>'F_RENDER'
,p_standard_attributes=>'REGION:JQUERY_SELECTOR:REQUIRED'
,p_substitute_attributes=>true
,p_subscribe_plugin_settings=>true
,p_help_text=>'This Plug-in brings Vanta.js animations easy to your APEX app. WebGL makes the animations much prettier and more CPU efficient than CSS or SVG animations. E.g. Pimp your login screen with a very nice sky flight.'
,p_version_identifier=>'1.0'
,p_about_url=>'https://github.com/RonnyWeiss/APEX-Vanta-js-Plugin'
,p_files_version=>1334
);
